  ["Maria", "Fenyane",22, "Lebowakgomo"],
  ["Julia", "Masipa",15, "Tembisa"]

],

test1 = [],
test2 = [],

i;

for (i = 0; i < top10.length; i++){
  test1.push([top10[i][0], top10[i][1]]);
  test2.push([top10[i][1], top10[i][2]]);
